const HanyinPlugin = uni.requireNativePlugin('Hanyin-Plugin'); //汉印
// #endif
import Vue from 'vue';
import store from 'store';
import {
	SET_CONNECTBLEDATA
} from '@/store/actionsType.js';

/**
 * 1.确定好模板
 * 2.用户选择蓝牙后初始化打印机值
 * 3.等待客户点击打印
 */
let title;
//模板数据
const printTemplate = Vue.prototype.$Mock.printTemplate;
const printTemplate2 = Vue.prototype.$Mock2.printTemplate;
let { pagConfig , printItem } = printTemplate;
let { pagConfig2 ,printItem2 } = printTemplate2;
		// pageLeft = Number(pagConfig.pageLeft);
		// pageTop = Number(pagConfig.pageTop);
		// pageHeight = Number(pagConfig.pageHeight);
		// pageWidth = Number(pagConfig.pageWidth);
const MULTIPLE = 8; //打印机计算比例
let pageLeft=Number(pagConfig.pageLeft) || 0,  //打印模板整体左偏移量
    pageTop=Number(pagConfig.pageTop) || 0,   //打印模板整体上偏移量
	pageHeight=Number(pagConfig.pageHeight) || 0,  //打印模板页面高度
	pageWidth=Number(pagConfig.pageWidth) || 0;  //打印模板页面宽度
const TRANSFORM = 3.8;  //尺寸转换单位
//数据处理参数对象
const filterData = {
    size_conversion:function(value){
		return Math.round(Number(value) / TRANSFORM);
	}
}
const instructions = {
	"cross":function(list,data,printIndex){
		let x0 = (filterData.size_conversion(Number(list.left)) + pageLeft) * MULTIPLE;
		let y0 = (filterData.size_conversion(Number(list.top)) + pageTop) * MULTIPLE;
		let x1 = ((filterData.size_conversion(list.width) + filterData.size_conversion(list.left))  + pageLeft < pageWidth ? (filterData.size_conversion(list.width) + filterData.size_conversion(list.left) + pageLeft) : pageWidth)  * MULTIPLE
		let y1 = y0;
		let width = filterData.size_conversion(list.height) > 0 ? filterData.size_conversion(list.height) : 1;
		// console.log(x0,y0,x1,y1,width);
		//水平线
		HanyinPlugin.Line({x0,y0,x1,y1,width}, result => {
			console.log(result);
		})
		
	},
	"vertical":function(list,data,printIndex){
		let x0 = (filterData.size_conversion(Number(list.left))  + pageLeft) * MULTIPLE;
		let y0 = (filterData.size_conversion(Number(list.top)) + pageTop) * MULTIPLE;
		let x1 = x0;
		let y1 = (filterData.size_conversion(Number(list.height)) + filterData.size_conversion(Number(list.top)) + pageTop) * MULTIPLE;
		let width = filterData.size_conversion(list.width) > 0 ? filterData.size_conversion(list.width) : 1;
		// console.log(x0,y0,x1,y1,width);
		//垂直线
		HanyinPlugin.Line({x0,y0,x1,y1,width}, result => {
			console.log(result);
		})
		
	},
	"text":function(list,data,printIndex){
		let x = (filterData.size_conversion(Number(list.left)) + pageLeft) * MULTIPLE;
		let y = (filterData.size_conversion(Number(list.top)) + pageTop) * MULTIPLE;
		let width = filterData.size_conversion(Number(list.width)) * MULTIPLE;
		let height = filterData.size_conversion(Number(list.height)) * MULTIPLE;
		let size = Number(list.fontSize);   // 3 4 8 55
		let str = list.text;
		let isbole;
		let xAlign = "left";
		let yAlign = "left";
		if(list.textAlign === "left"){
			xAlign = "left";
		}else if(list.textAlign === "center"){
			xAlign = "center";
		}else if(list.textAlign === "right"){
			xAlign = "bottom";
		}
		
		isbole = Number(list.fontWeight) <= 400 ? false : true;  //加粗
		if(size >= 2 && size <= 7){
			size = 55   //16x16 或8x16，视中英文而定
		}else if(size > 7 && size <= 9){
			size = 8;   //24x24 或12x24，视中英文而定 
		}else if(size > 9 && size <= 16){
			size = 3;   //20x20 或10x20，视中英文而定。
		}else{
			size = 4;   //32x32 或16x32，由ID3 字体宽高各放大2 倍
		}
		console.log(x,y,width,size,isbole,str);
		//文本(静态)  后续判断字体是否居中 如是: AutCenter 否 AutLine
		HanyinPlugin.AutLine({x,y,width,size,isbole,isdouble: false,str,type: "1"}, result => {
			console.log(result);
		})
	},
	"field":function(list,data,printIndex){
		let x = (filterData.size_conversion(Number(list.left)) + pageLeft) * MULTIPLE;
		let y = (filterData.size_conversion(Number(list.top)) + pageTop) * MULTIPLE;
		let width = filterData.size_conversion(Number(list.width)) * MULTIPLE;
		let height = filterData.size_conversion(Number(list.height)) * MULTIPLE;
		let size = Number(list.fontSize);   // 3 4 8 55
		let isbole;
		let str = data[list.dataId];
		let xAlign = "left";
		let yAlign = "left";
		
		if(list.textAlign === "left" || list.textAlign === "start"){
			xAlign = "left";
		}else if(list.textAlign === "center"){
			xAlign = "center";
		}else if(list.textAlign === "right"){
			xAlign = "bottom";
		}
		
		isbole = Number(list.fontWeight) <= 400 ? false : true;  //加粗
		if(size >= 2 && size <= 7){
			size = 55;
		}else if(size > 7 && size <= 9){
			size = 8;
		}else if(size > 9 && size <= 16){
			size = 1;
		}else{
			size = 4;
		}
		//文本(动态)
		HanyinPlugin.AutLine({x,y,width,size,isbole,isdouble: false,str,type: "1"}, result => {
			console.log(result);
		})
	},
	"barCode":function(list,data,printIndex){
		let x = (filterData.size_conversion(Number(list.left)) + pageLeft) * MULTIPLE;
		let y = (filterData.size_conversion(Number(list.top)) + pageTop) * MULTIPLE;
		let height = filterData.size_conversion(Number(list.height))  * MULTIPLE;
		let width = filterData.size_conversion(Number(list.width))  * MULTIPLE;
		let str = data[list.dataId];
		console.log(list);
			let undertext = true,command=0;
			if(Number(list.width) > Number(list.height)){
				//水平
				command = 0;
			}else{
				//垂直
				command = 1;
			}
			//条形码  -- 后期补充条形码type类型
			HanyinPlugin.Barcode({
				command,
				type:"code128",
				width: "1",
				ratio: "2",
				height:height + "",
				x,
				y,
				undertext,
				number: "7",
				size: "0",
				offset: "1",
				data:str
			}, result => {
				console.log(result);
			})
		
	},
	"img":function(list,data,printIndex){
		let x = (filterData.size_conversion(Number(list.left)) + pageLeft) * MULTIPLE;
		let y = (filterData.size_conversion(Number(list.top)) + pageTop) * MULTIPLE;
		let url = "data:image/jpg;base64,";;

			//静态图片
			HanyinPlugin.Expanded({x,y,img:url,type:0,light:0},result=>{
				console.log(result);
			})
		
	},
	"qrCode":function(list,data,printIndex){
		// console.log(x,y,QRData);
		let x = (filterData.size_conversion(Number(list.left)) + pageLeft) * MULTIPLE;
		let y = (filterData.size_conversion(Number(list.top)) + pageTop) * MULTIPLE;
		let QRData = data[list.dataId];
		// let QRData = 'https://register.gbn.red/tracing/?tracingCode=GBN-bab935ea4aa249169678bd9508805235'
		let width = filterData.size_conversion(Number(list.width));
		let m = "1";
		// filterData.size_conversion(Number(list.width))
		let u = filterData.size_conversion(Number(list.width)) - 6;
		//二维码
		HanyinPlugin.PrintQR({command:0,x,y,m,u,data:QRData},result=>{
			console.log(result);
		})
	},
	"qrCode2":function(list,data,printIndex){
		// console.log(x,y,QRData);
		let x = (filterData.size_conversion(Number(list.left)) + pageLeft) * MULTIPLE;
		let y = (filterData.size_conversion(Number(list.top)) + pageTop) * MULTIPLE;
		let QRData = data[list.dataId];
		// let QRData = 'https://register.gbn.red/tracing/?tracingCode=GBN-bab935ea4aa249169678bd9508805235'
		let width = filterData.size_conversion(Number(list.width));
		let m = "1";
		// filterData.size_conversion(Number(list.width))
		let u = filterData.size_conversion(Number(list.width)) - 6;
		//二维码
		HanyinPlugin.PrintQR({command:0,x,y,m,u,data:QRData},result=>{
			console.log(result);
		})
	}
}
//执行模板打印指令
const Print_Template = {
	// 汉印模板
	hanyin(data,printIndex) {
		// let {pagConfig,printItem} = printTemplate;
		// pageLeft = Number(pagConfig.pageLeft);
		// pageTop = Number(pagConfig.pageTop);
		// pageHeight = Number(pagConfig.pageHeight);
		// pageWidth = Number(pagConfig.pageWidth);
		// console.log(pageLeft,pageTop,pageHeight,pageWidth);
		//设置页面
		HanyinPlugin.PrintAreaSize({
			offset: "0",
			Horizontal: "100",
			Vertical: "100",
			Height: (pageHeight + pageTop) * MULTIPLE +"",
			Qty: "1"//打印次数
		}, result => {
			console.log(result);
		})
		//打印宽度
		HanyinPlugin.PageWidth({
			pw: (pageWidth + pageLeft) * MULTIPLE
		}, result => {
			console.log(result);
		})
		//遍历模板控件
		if(data.id == 1){
			console.log('打印子码')
			printItem.forEach(item=>{
				instructions[item.type](item,data,printIndex);
			});
		}else{
			console.log('打印父码')
			console.log(Vue.prototype.$Mock.printTemplate)
			console.log(Vue.prototype.$Mock2.printTemplate)
			printItem2.forEach(item=>{
				instructions[item.type](item,data,printIndex);
			});
		}
			
		//启动打印
		HanyinPlugin.Form({}, result => {
			console.log(result);
		})
		HanyinPlugin.Print({}, result => {
			console.log(result);
			if (result.state > 0) {
				uni.showToast({
					icon: "none",
					title: "打印正常",
					duration: 2000
				})
			} else {
				uni.showToast({
					icon: "none",
					title: "打印异常",
					duration: 2000
				})
			}
		})
	}
}

//打印机连接指令
export default class printConnect {
	constructor(options) {
		/**
		 *1.根据蓝牙名称判断打印机类型
		 *2.连接指定打印机
		 */
		console.log(options);
		this.name = options.name; //蓝牙打印机名称
		this.mac = options.mac; //蓝牙打印机地址
		this.isConnect = false; //是否连接打印机开关
		this.printIndex = null; //打印机标识
		this.print_sign(this.name);
	}
	//判断打印机牌子,打印出面单
	print_sign(name) {
		uni.showLoading({
			title: "连接中...",
			mask: true
		})
		//判断打印机名称是以什么开头
			console.log("汉印打印机");
			this.connect_hanyin(this.mac);
		
	}
	//汉印打印机连接
	connect_hanyin(mac) {
		this.disconnect();
		HanyinPlugin.PortOpenBT({
			mac
		}, result => {
			console.log(result);
			switch (result.state) {
				case 0:
					title = "连接成功";
					this.isConnect = true;
					// store.dispatch(SET_CONNECTBLEDATA, {name:this.name,mac:this.mac});
					break;
				case -1:
					title = "连接异常";
					this.connect_hanyin();
					break;
				case -2:
					title = "地址格式错误";
					break;
				case -3:
					title = "握手指令错误";
					break;
				default:
					title = "";
			}
			uni.hideLoading();
			uni.showToast({
				icon: "none",
				title,
				duration: 2000
			})
		})
	}
	//启动打印命令
	startPrint(data) {
		console.log(data);
		console.log(this.printIndex);
		// obj 订单数据
		//汉印
		Print_Template.hanyin(data,this.printIndex);
		
	}
	//断开打印机连接
	disconnect() {
		HanyinPlugin.PortClose({}, result => {
			console.log(result);
		});
	}
}
